import { Text, TouchableOpacity, View } from "react-native";

const DishRow = ({ id, name, description, price, image }) => {
  return (
    <TouchableOpacity>
      <View>
        <Text>{name}</Text>
      </View>
    </TouchableOpacity>
  );
};

export default DishRow;
